import React from 'react';

import styles from './LaunchItem.module.scss';

export default function LaunchItem({ flight }) {
  console.log(flight);
  return (
    <div className={styles.card}>
      <div className={styles.left_container}>
        <div>
          <h3 className={styles.header_3}>Flight No. {flight.flight_number}</h3>
          <h4 className={styles.mission_name}>Mission: {flight.name}</h4>
        </div>
      </div>

      <div className={styles.right_container}>
        <button className='button_primary'>Launch Details</button>
      </div>
    </div>
  );
}
